description:
Naast de goa'uld vormen ook de replicators, intelligente zelfreplicerende machines, een bedreiging. De Asgard worden bijna door hen uitgeroeid.

17.A Hundred Days - 4 februari 2000 - Een metorietenregen begraaft de stargate en O'Neill zit voor altijd vast.

18.Shades of Grey - 11 februari 2000 - O'Neill steelt Tollan technologie en wordt ontslagen. Maybourne doet een opmerkelijk voorstel.

19.New Ground - 18 februari 2000 - SG-1 wordt gevangengenomen op een planeet die in oorlog is vanwege de Stargate.

20.Maternal Instinct - 25 februari 2000 - Daniel ontdekt de locatie van het Harsisis kind maar hij is niet de enige.
